        "content": {
            "text": "Evaluation: We do not use automated evaluationmetrics and instead use human evaluations for tworeasons. First, there are currently no metrics inthe literature that assess whether the returned rea-soning chains are “correct” from a commonsenseperspective. Second, evaluating dialog systemsis challenging. It is debated that metrics such asBLEU (Papineni et al., 2002) and perplexity oftenfail to measure true response quality (Liu et al.,2016; Li et al., 2016).Experiments: In the first experiment, we evalu-ate our multi-hop prover in isolation and withoutconversational interactions. The human evaluatorsin this study are expert evaluators. In our secondexperiment, we test ÉåïÖ’s performance end-to-end with non-expert human users and investigatethe efficacy of the conversational interactions. In or-der to be comparable with Arabshahi et al. (2021)’sstudy, we use the knowledge base of commonsensefacts and rules, K, released with the dataset. Itcontains 228 facts and rules. Our COMET model ispre-trained on knowledge graphs ConceptNet andATOMIC. We used COMET’s open-source code1for training with the hyper-parameters reportedthere (Bosselut et al., 2019)."
        },
