        "content": {
            "text": "Pruning the Proof Search Space In order toform a reasoning chain (proof) for an if-then-because command using COMET, we leveragethe logic templates discussed in Sec. 2. All thetemplates consist of a conjunction of two logi-cal implications. For each implication (Head DBody), the Head and Body are given in the if-then-because command. For example, the goal andstate in the first implication of the purple tem-plate ( goal Dstate ) are extracted from theinput command. Therefore, in order to prove thefirst implication, we need to find a chain of rea-soning that leads from the state to the goal in aseries of N hops. In order to do that, we either per-form unidirectional or bidirectional beam search asexplained below.Unidirectional Beam Search: Here, for a givennumber of hops N, we first construct all beam re-sults O1 =COMET(re, s1) where s1 is the naturallanguage clause that corresponds to the Body ofthe implication in the logic template, and for all rethat are post-effect COMET relations. We continueto query COMET(re,o jn) recursively in a breadth-first manner for ∀o jn ∈On where n ∈[1,..., N] isthe hop index. In each hop, we only continue thequery for the top K results ranked by the semanticcloseness of the returned beam result o jn and the im-plication’s Head, where K is the search’s beam size.At the Nth hop, the prover returns proof chains forwhich oN is semantically close to the implication’sHead, which corresponds to the goal .Bidirectional Beam Search: Here, we constructall possible beam results of COMET(re, s1), wheres1 is the natural language clause that correspondsto the implication’s Body, for all re that are post-effect relations as well as COMET(rc,oN ), whereoN is the natural language clause corresponding tothe Head of the implication in the logic template,for all rc that are pre-condition relations. The proofsucceeds when two intermediate beam results aresemantically close in the beam search path fromeither direction (Fig 5)."
        },
