            "text": "ÉåïÖ(ConversationaL mUlti-hop rEasoner) isa commonsense reasoning engine that inputs if-then-because commands and outputs a reasoningchain (proof) containing if-then logical statementsthat indicates how the action achieves the user’sgoal when the state holds. ÉåïÖis built on topof CORGI and is triggered when CORGI fails. Itconsists of three components: (1) the parser, (2) themulti-hop prover (reasoner), and (3) the dialog sys-tem (Figure 2). The Parser takes in the commandand extracts the state , action and goal fromit. At the second step, the prover attempts to findreasoning chains that connect the action to thegoal when the state holds. The extracted rea-soning chains go through the dialog system thatgenerates and presents contextualized questions toa human user who either validates a returned rea-soning chain or contributes novel knowledge toÉåïÖif none of the reasoning chains are correct"
