        "content": {
            "text": "Summary of Results and Contributions: Thecontributions of this paper are two-fold. First, wepropose a novel conversational commonsense rea-soning approach called ConversationaL mUlti-hoprEasoner (ÉåïÖ) that incorporates CommonsenseTransformers (COMET), a large scale neural com-monsense KB, as its main source of backgroundknowledge. We propose a multi-hop knowledgequery mechanism that extracts reasoning chains byiteratively querying COMET. This mechanism uses,for the first time, a few symbolic logic templatesto prune the reasoning search space, significantlyimproving the quality of the generated common-sense knowledge. Second, we propose a conver-sational knowledge acquisition strategy that usesthe knowledge extracted from COMET to dynami-cally ask contextual questions to humans wheneverthere is missing knowledge. We ran a user studyand evaluated our proposed approach using real hu-man users. Our results show that ÉåïÖachievesa 35% higher success rate compared to a baseline,which uses a less sophisticated conversational inter-face and a smaller background knowledge on thebenchmark dataset. We also extensively evaluatethe performance of the reasoner in an isolated non-conversational setting and empirically re-iterate theneed for conversational interactions. ÉåïÖ’s com-ponents were not trained on the benchmark dataset.Therefore, our results assess the performance ofÉåïÖ’s zero-shot reasoning"
        },
