        "content": {
            "text": "2.2 CORGICOmmonsense ReasoninG By Instruction(CORGI; Arabshahi et al. (2021)) is the SOTAcommonsense reasoning engine designed forinferring commonsense presumptions of if-then-because commands. CORGI has a neuro-symbolicreasoning module (theorem prover) that generatesmulti-hop reasoning trees given if-then-becausecommands. The neuro-symbolic reasoning moduleis a soft logic programming system that reasonsusing backward chaining (a backtracking algo-rithm). CORGI does not use the logic templatesto do reasoning. One of the main limitations ofCORGI is that it uses a small hand-crafted KBthat is not diverse enough to reason about allthe if-then-because commands in the benchmarkdataset. CORGI was tested only on 10 commandsin the released benchmark (Arabshahi et al., 2021).Moreover, CORGI’s KB is programmed in asyntax similar to Prolog (Colmerauer, 1990), butlarge-scale commonsense Prolog-like knowledgebases are not readily available. Therefore, in thispaper we propose to use a large-scale SOTA neuralcommonsense KB which both extends that limitedsource of background knowledge and also enablesthe use of a new type of knowledge source.CORGI is equipped with a conversational in-teraction strategy to acquire knowledge from hu-mans when that knowledge is missing from the KB.However, CORGI uses a static question generationstrategy that often confuses the end-users. First,the parser often omits verb conjugation or subjects,resulting in grammatically incorrect questions. Sec-ond, the static question generation strategy does notalways generate contextual queries. Therefore, inthis paper we propose a dynamic question genera-tion strategy that generates more relevant questionsresulting in a higher quality knowledge extractionfrom humans. We also include a more robust parserto ensure the questions are grammatically correct."
        },
